const defaultState = {
    files: [],
    current: null
};

const SET_FILES = "SET_FILES";
const SET_CURRENT_DIR = "SET_CURRENT_DIR";

export const fileReducer = (state = defaultState, action) => {
    switch (action.type) {

        default:
            return state;
    }
}
